r($,"b3f","a1W",()=>A.oE("Wie wir uns gefunden haben\n\n Es gibt viele Wege, die zwei Menschen zueinander f\xfchren. Manche lernen sich in der Schule kennen, andere \xfcber Freunde, wieder andere durch Zuf\xe4lle, die zu sch\xf6n sind, um nur Zufall zu sein. Unsere Geschichte beginnt an einem Ort, an dem keiner von uns erwartet h\xe4tte, die Liebe seines Lebens zu treffen: im Supermarkt.\n\n Es war ein verregneter Samstagnachmittag, und wie immer hatte ich meine Einkaufsliste in der einen Hand und mein Handy in der anderen. Ich war in Eile, wollte nur schnell ein paar Sachen besorgen und wieder nach Hause. Doch das Leben hatte andere Pl\xe4ne.\n\n An der Obst- und Gem\xfcsetheke stand er \u2013 oder besser gesagt, er k\xe4mpfte mit einer Ananas. Ja, tats\xe4chlich. Ich beobachtete, wie er versuchte, das widerspenstige Ding in eine dieser d\xfcnnen Plastikt\xfcten zu bekommen, ohne dass es wieder herausrollte. Ich konnte nicht anders, ich musste lachen.\n\n \u201eSoll ich helfen?\u201c fragte ich, noch immer grinsend.\n\nEr sah mich an, ebenfalls grinsend, und gab die Ananas schlie\xdflich auf. \u201eIch glaube, das Ding will einfach nicht mit.\u201c\n\nDamit war das Eis gebrochen. Wir kamen ins Gespr\xe4ch \u2013 erst \xfcber Ananas, dann \xfcber Essen im Allgemeinen, und schlie\xdflich \xfcber alles M\xf6gliche. Was als kurzer Supermarktbesuch geplant war, wurde zu einer Stunde, die wir zwischen den Regalen verbrachten. Wir verga\xdfen fast, warum wir \xfcberhaupt dort waren.\n\nAm Ende des Einkaufs war es unausweichlich: Wir mussten uns wiedersehen. Er bat mich um meine Nummer, und obwohl ich normalerweise eher zur\xfcckhaltend war, sagte mein Bauchgef\xfchl sofort: \u201eJa.\u201c\n\nUnser erstes offizielles Date fand nur wenige Tage sp\xe4ter in einem kleinen Caf\xe9 statt, nicht weit vom Supermarkt entfernt. Es f\xfchlte sich an, als w\xfcrden wir uns schon ewig kennen. Wir lachten, redeten und merkten schnell, dass wir dieselbe Art von Humor teilten \u2013 was f\xfcr uns beide unglaublich wichtig war.\n\nVon da an folgten unz\xe4hlige weitere Treffen, Spazierg\xe4nge im Park, Kochabende, bei denen er versuchte, Ananas in jedes Gericht zu schmuggeln \u2013 und schlie\xdflich der Moment, in dem wir wussten: Das hier ist f\xfcr immer.\n\nHeute stehen wir hier, an unserem Hochzeitstag, umgeben von Familie und Freunden, und ich kann mit voller \xdcberzeugung sagen: H\xe4tte mir damals jemand gesagt, dass eine Ananas mein Leben f\xfcr immer ver\xe4ndern w\xfcrde, ich h\xe4tte es nicht geglaubt. Aber manchmal f\xfchrt das Schicksal zwei Menschen auf den ungew\xf6hnlichsten Wegen zueinander \u2013 und genau das macht unsere Geschichte so besonders.\n\nAlso, wenn ihr das n\xe4chste Mal im Supermarkt seid und jemanden mit einer Ananas k\xe4mpfen seht \u2013 vielleicht ist das gerade der Anfang von etwas Wundersch\xf6nem. \u2764\ufe0f",t.N))
